import React from "react";
import { Image, Dimmer, Segment } from "semantic-ui-react";

import "../css/App.css";
import image from "../assets/mountain.jpg";

const styles = {
  image: {
    height: "75vh",
    width: "100vw",
    zIndex: "10",
    backgroundColor: "rgba(0,0,0,0.5)"
  }
};
class Img extends React.Component {
  render() {
    return <Image src={image} style={styles.image} fluid />;
  }
}

export default Img;
